import { RichText } from "prismic-reactjs";
import grid from "styles/grid.module.scss";

export default function Heading({ slice }) {
	return (
		<section className={`${styles.section} ${grid.col}`}>
			{<RichText render={slice.primary.text} />}
		</section>
	);
}
